	<script>
        $(()=>{
            table_col_index()

            tot_col("#Dat_Weichert120",2, "#Tot_Weichert120")
        })



        function tot_col(tbid, col, outid){
            var tot=0;
            $(tbid).find("tr").each(function(){
                var txt = $(this).find(`td:eq(${col})`).text().replace(",","")
                var val = parseFloat(txt)
                tot+=val
            })
            $(outid).text(tot.toFixed(2))
        }
    </script>
